CREATE TABLE "public"."algorithm_settings" ("id" serial NOT NULL, "simulator_id" integer, "real_dataset_id" integer, "algorithm_setting_name" text NOT NULL, PRIMARY KEY ("id") , FOREIGN KEY ("real_dataset_id") REFERENCES "public"."real_datasets"("id") ON UPDATE no action ON DELETE no action, FOREIGN KEY ("simulator_id") REFERENCES "public"."simulators"("id") ON UPDATE no action ON DELETE no action, UNIQUE ("algorithm_setting_name"), UNIQUE ("id"));
